import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { useCallback } from 'react'
import { useNavigate } from 'react-router-dom'
import { likeList } from '../store/actions/likeProducts'
import Header from '../components/Header'
import Footer from '../components/Footer'
import Menu from "../components/Menu";



export default function LikeProducts() {

  const dispatch = useDispatch()
  const likes = useSelector((state) => state.likes.likes)
  const likeProduct = useSelector((state) => state.likes.likeProducts)
  const navigate = useNavigate()


  useEffect(() => {

    (async () => {
      await dispatch(likeList())
    })()

  }, [])


  const singleItem = useCallback((item) => {
    navigate(`/home/${item.id}`)
  }, [])
  const [isOpen, setIsOpen] = useState(false);
  const catList = useSelector((state) => state.category.catList);
  const category = useSelector((state) => state.category.catProducts);


  useEffect(() => {
      dispatch(categoryList());
  }, []);


  const handleClick = useCallback((id) => {
      console.log(id)
  }, []);


  const toggle = useCallback(() => {
      setIsOpen(!isOpen);
  }, [isOpen]);

  const handleClose = useCallback(() => {
      setIsOpen(false);
  }, []);


  return (

    <>
      <Header />

      <h1>Hello</h1>
      <div className='navMenu'>
                <MenuIcon style={{ fontSize: 50, color: 'white', marginTop: -10 }} onClick={toggle} />
                {isOpen ? (
                    <>
                        <div className='navBtn'>
                            {catList.map((item) => (
                                <div className='menuButton' key={item.id}>
                                    <button onClick={() => handleClick(item.id)}>{item.title}</button>
                                </div>
                            ))}
                        </div>
                        <button className='closeButtonStyle' onClick={handleClose}>X</button>
                    </>
                ) : null}
            </div>

      <Footer />

    </>

  )
}
